            return res.send({
                data: result,
                error: null,
                success: 'ok'
            })
        } catch (error) {
            return res.send({
                data: null,
                error: error,
                success: null
            })
        }
    },
    async delete(req, res) {
        try {
            const companyId = req.params.id;
            const company = await companyHandler.deleteCompany(companyId);
            return res.send({
                data: company,
                error: null,
                success: 'ok'
            });
        } catch (error) {
            return res.send({
